import React, { useEffect } from 'react'
import io from 'socket.io-client'
import { GET_URL_FOR_SOCKET } from '../../Config/index'
const Index = (props) => {
	const socket = io(`${GET_URL_FOR_SOCKET}/room`)
	useEffect(() => {
		socket.on('connection', () => {
			console.log('hello')
		})
	}, [])
	const { room } = props
	return (
		<div class='status-room'>
			<div class='room-name'>
				<p>Room name : {room}</p>
			</div>
			<div class='participant'>
				<p>Number Participant : 20</p>
			</div>
			<div class='button-close'>
				<i class='fas fa-times-circle close-btn'></i>
			</div>
		</div>
	)
}

export default Index
